    false,nt"url": null,nt"notes": "Reson 8101ER multibeam Data were collected
    between 21 August and 13 September 2003 (JD 233-256) aboard NOAA Survey Launch Acoustic
    Habitat Investigator (AHI) at Saipan and Tinian Islands and Tatsumi and Marpi Banks
    in the Commonwealth of the Northern Mariana Islands in the Western Pacific during
    cruise OES-03-07/AHI-03-07. The AHI was deployed independently from the NOAA Ship
    Oscar Elton Sette (OEs). The multibeam data were logged into data set Saipan and
    collected using SAIC ISS-2000 software in the Generic Sensor Format and processed
    using SABER editing software. Sound velocity corrections from a Seabird SBE19 CTD
    sensor and motion corrections from a POS-MV vertical reference were applied to the
    data in real time. Predicted tides were applied to the data in real time and observed
    tides from Guam tide gauge 1630000 with a time corrector of 18 minutes and a tide
    height multiplier of 0.94 were applied using SABER postprocessing software. Horizontal
    accuracy is 20m (no differential GPS correctors applied), vertical accuracy is depth
    dependent (~1% of water depth), WGS84 datum. These data are not to be used for navigation.
    Depths mapped range from 10 - 300 m.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
